{{ _.each(data, function(level) { }}
<li class="level button {{- level.axisClass}} {{- level.itemClass}}" data-name="{{- level.name}}" data-fieldName="{{- level.fieldName}}" style="z-index: 800">

    <js-templateNonce></js-templateNonce>
    <span class="level wrap" title="{{- level.label }}">{{- level.label }}</span>
    <span class="icon remove"></span>
</li>
{{ }); }}
